import React, { Component } from 'react';
import {
    PopupboxManager,
    PopupboxContainer
} from 'react-popupbox';

export default function Test() {
    function openPopupbox() {
        const contentSign = (
            <div>
                <div className="apply-vacancy-title-text">
                    <p className="apply-vacancy-title-popup">
                        <span className="color-text-main-signin">Працюй із задоволенням</span>
                        <span className="color-text-signin">та отримуй гідну зарплатню</span>
                    </p>
                </div>
            </div>
        )
        PopupboxManager.open({
            contentSign,
            config: {
                titleBar: {
                    enable: true,
                },
                fadeIn: true,
                fadeInSpeed: 500
            }
        })
    }


        return (
            <div>
                <button onClick={openPopupbox}>Click me</button>
                <PopupboxContainer />
            </div>
        )

}
